// import Nav from './Nav';
// import Photo from './Photo';

const images = [
  {
      src:"https://farm5.staticflickr.com/4334/37032996241_4c16a9b530.jpg",
      id:1
  },
  {
      src:"https://farm5.staticflickr.com/4334/37032996241_4c16a9b530.jpg",
      id:2
  },
  {
      src:"https://farm5.staticflickr.com/4334/37032996241_4c16a9b530.jpg",
      id:3
  },
  {
      src:"https://farm5.staticflickr.com/4334/37032996241_4c16a9b530.jpg",
      id:4
  },
]

const Nav = () => {

  return(
      <nav className="main-nav">
          <ul>
              <li><a href='3'>Cats</a></li>
              <li><a href='#'>Dogs</a></li>
              <li><a href='#'>Computers</a></li>
          </ul>
      </nav>
  );
}

const Photo = (props) => {

  return (
      <div className="photo-container">
          <h2>Results</h2>
          <ul>
             {props.images.map(image =>
                <li><img src={image.src}></img></li>
              )}
          </ul>
      </div>
  );
}


const App = () => {

  return (
    <div className="container">
      <Nav />
      <Photo 
        images={images}
      />

    </div>



  );
}

export default App;
